using namespace std;
class Solution {
public:
    map<string,int> myMap;
    
    void permute(string str){
        sort(str.begin(), str.end());
        do {
            myMap[str] = 1;
        }       while (next_permutation(str.begin(), str.end()));
    }
    
    
    vector<int> findAnagrams(string s, string p) {
        vector<int> result;
        permute(p);
        int n = s.length();
        int m = p.length();
        int i = 0;
        int j = m;
        while(i+j<n){
            string r = s.substr(i,j);
            map<string,int>::iterator k;
            k = myMap.find(r);
            if(k!=myMap.end()){
                result.push_back(i);
            }
            i++;
        }
        return result;
    }
	
	
};

double fact(int n){
	if(n==1)return 1;
	return n*fact(n-1);
}
